function Projects() {
  return (
    <section>
      <h2>Projects</h2>
      <ul>
        <li>
          <strong>Project One:</strong> Description of your project and technologies used.
        </li>
        <li>
          <strong>Project Two:</strong> Description of your project and technologies used.
        </li>
      </ul>
    </section>
  );
}

export default Projects;
